def getIP():
        #随机取得A/B/C其中一类IP地址
        randNum = random.randrange(0, 3)
        if randNum == 0:
            return '.'.join([str(random.randrange(1, 127)), str(random.randrange(0, 256)),str(random.randrange(0, 256)), str(random.randrange(0, 256))])
